function displayTableData(data) {
  const tableBody = document.getElementById("table-body");
  if (!tableBody) {
    console.error("Table body element not found");
    return;
  }
  tableBody.innerHTML = "";
  data.forEach((row, index) => {
    const tr = document.createElement("tr");
    Object.values(row).forEach((val, index) => {
      const td = document.createElement("td");
      if (index === 0) {
        td.classList.add("address-column");
        td.textContent = val;
      } else {
        td.textContent = val;
        td.classList.add("numeric-column");
      }
      tr.appendChild(td);
    });
    const serialTd = document.createElement("td");
    serialTd.textContent = index + 1;
    serialTd.classList.add("serial-number-column");
    tr.insertBefore(serialTd, tr.firstChild);
    tableBody.appendChild(tr);
  });
}

displayTableData(tableData);

const searchInput = document.getElementById("search-input");
if (!searchInput) {
  console.error("Search input element not found");
} else {
  searchInput.addEventListener("keyup", () => {
    const filter = searchInput.value.toUpperCase();
    const tableRows = document.querySelectorAll(
      "#account-status-table tbody tr"
    );
    tableRows.forEach((row) => {
      const address = row
        .getElementsByTagName("td")[0]
        .textContent.toUpperCase();
      if (address.includes(filter)) {
        row.style.display = "";
      } else {
        row.style.display = "none";
      }
    });
  });
}
